import React, { useEffect } from 'react';
import { useParams } from 'react-router-dom';
import LoadingSpinner from '../../shared/components/UIElements/LoadingSpinner';
import ErrorModal from '../../shared/components/UIElements/ErrorModal';
import { useHttpClient } from '../../shared/hook/http-hook';

import PlaceList from '../components/PlaceList';

const UserPlaces = () => {
  const { sendRequest, errorHandler, loading, errorMessage, resData } =
    useHttpClient();
  const UserId = useParams().UserId;
  const loadedPlaces = resData.userPlace;
  console.log(loadedPlaces);

  useEffect(() => {
    const fetchUsers = async () => {
      await sendRequest('http://localhost:5000/api/places/users/' + UserId)
        .then(successfulResponse)
        .catch(error);

      function successfulResponse(response) {}

      function error(error) {}
    };
    fetchUsers();
  }, [UserId, sendRequest]);

  return (
    <React.Fragment>
      {loading && <LoadingSpinner asOverlay />}
      <ErrorModal error={errorMessage} onClear={errorHandler} />
      <PlaceList items={loadedPlaces} />;
    </React.Fragment>
  );
};

export default UserPlaces;
